	"sap/fe/macros/filterBar/DraftEditState.fragment.xml":'<core:FragmentDefinition\n\txmlns:template="http://schemas.sap.com/sapui5/extension/sap.ui.core.template/1"\n\txmlns="sap.m"\n\txmlns:mdc="sap.ui.mdc"\n\txmlns:mdcf="sap.ui.mdc.field"\n\txmlns:mdcv="sap.ui.mdc.valuehelp"\n\txmlns:mdcvc="sap.ui.mdc.valuehelp.content"\n\txmlns:core="sap.ui.core"\n\ttemplate:require="{\n\t\tID: \'sap/fe/core/helpers/StableIdHelper\',\n\t\tEDITSTATE: \'sap/fe/macros/filterBar/DraftEditState\'\n\t}"\n><mdc:FilterField\n\t\tlabel="{sap.fe.i18n>FILTERBAR_EDITING_STATUS}"\n\t\tmaxConditions="1"\n\t\tid="{= ID.generate([${this>id}, \'FilterField\', \'DraftEditingStatus\' ]) }"\n\t\toperators="DRAFT_EDIT_STATE"\n\t\tdataType="sap.ui.model.odata.type.String"\n\t\tpropertyKey="$editState"\n\t\tconditions="{$filters>/conditions/$editState}"\n\t\tvalueHelp="{= ID.generate([${this>id}, \'FilterFieldValueHelp\', \'DraftEditingStatus\' ]) }"\n\t\tdisplay="Description"\n\t><mdc:dependents><mdc:ValueHelp id="{= ID.generate([${this>id}, \'FilterFieldValueHelp\', \'DraftEditingStatus\' ]) }"><mdc:typeahead><mdcv:Popover><mdcvc:FixedList useFirstMatch="true"><template:with path="this>" helper="EDITSTATE.getEditStatesContext" var="states"><template:repeat list="{states>}" var="state"><mdcvc:FixedListItem key="{state>id}" text="{state>display}" /></template:repeat></template:with></mdcvc:FixedList></mdcv:Popover></mdc:typeahead></mdc:ValueHelp></mdc:dependents></mdc:FilterField></core:FragmentDefinition>\n',
