	"sap/fe/templates/ObjectPage/view/fragments/MacroChart.fragment.xml":'<core:FragmentDefinition\n\txmlns:template="http://schemas.sap.com/sapui5/extension/sap.ui.core.template/1"\n\txmlns="sap.m"\n\txmlns:macro="sap.fe.macros"\n\txmlns:core="sap.ui.core"\n\ttemplate:require="{\n\t\tHELPER: \'sap/fe/macros/chart/ChartHelper\',\n\t\tOP: \'sap/fe/templates/ObjectPage/ObjectPageTemplating\'\n\t}"\n><macro:Chart\n\t\tid="{visualizationDefinition>id}"\n\t\t_applyIdToContent="true"\n\t\tcontextPath="{visualizationDefinition>collection}"\n\t\tmetaPath="{presentationContext>annotationPath}"\n\t\tselectionMode="Multiple"\n\t\tchartDelegate="{= \'{name: \\\'sap/fe/templates/AnalyticalListPage/chart/FEChartDelegate\\\', payload: { chartContextPath: \\\'\' + HELPER.getCollectionName(${visualizationDefinition>collection}) + \'\\\', parameters:{$$groupId:\\\'$auto.Workers\\\'}, selectionMode: \\\'Multiple\\\' } }\' }"\n\t\tselectionChange=".handlers.onChartSelectionChanged"\n\t\theaderLevel=\'{= OP.getHeaderLevel(${subSection>}, ${section>subSections}.length > 1 )}\'\n\t\theaderStyle=\'{= ${section>subSections}.length > 1 ? "H5" :  "H4"}\'\n\t\tvariantSaved=".handlers.onVariantSaved"\n\t\tvariantSelected=".handlers.onVariantSelected"\n\t/></core:FragmentDefinition>\n',
